function getDiagram() {
	const diagram = $$(go.Diagram, {
		initialAutoScale: go.Diagram.Uniform,
		initialContentAlignment: go.Spot.Center, // center Diagram contents
		"undoManager.isEnabled": true, // enable Ctrl-Z to undo and Ctrl-Y to redo
		scrollMode: go.Diagram.InfiniteScroll,
		// "grid.visible": true,  // display a background grid for the whole diagram

		"toolManager.mouseWheelBehavior": go.ToolManager.WheelZoom,
		layout: $$(go.TreeLayout, { comparer: go.LayoutVertex.smartComparer, angle: 90, nodeSpacing: 30, layerSpacing: 30 }), // have the comparer sort by numbers as well as letters
		// other properties are set by the layout function, defined below
  });
  
  const templmap: go.Map<string, go.Part> = new go.Map();

	/*Adding a template for the nodes while containment is on and the user wants to see the nodes with containment.
	When containment is on, it's necessary for the nodes to have a template visualization for containment. */
	// 	templmap.add(DiagramContainment.CONTAINMENT, Templates.NodeTemplates.generateDefaultContainmentNodeTemplate(diagram));

	/* Adding a template for the nodes while containment is not enabled.
	This is the default view for nodes.*/
	templmap.add("OFF", generateNodeTemplate("Node", diagram) as go.Node);

	// For the default category, "", use the same template when containment is off;
	templmap.add("", templmap.get("OFF"));
	diagram.nodeTemplateMap = templmap;

	/*Group Template section*/
	const groupTemplateMap: go.Map<string, go.Group> = new go.Map();
	// Adding a template for the nodes while containment is not enabled.
	groupTemplateMap.add("OFF", generateGroupTemplateAsNode());
	// Adding a template for the nodes while containment is on and the user wants to see the nodes with containment.
	groupTemplateMap.add("ON", generateConditionalGroupNodeTemplate(diagram));

	// Making the default group template, "", the template for the groups when containment is off.
	groupTemplateMap.add("", groupTemplateMap.get("OFF"));
	diagram.groupTemplateMap = groupTemplateMap;
  return diagram;
}

function generateGroupTemplateAsNode(): go.Group {
  const groupTemp = generateNodeTemplate("Group") as go.Group;
  return groupTemp;
}

function generateConditionalGroupNodeTemplate(diagram: go.Diagram): go.Group {
  const groupPanel = () => groupPanelContent(diagram);
  const nodePanel = () => nodePanelContent(diagram);
  const template = $$(go.Group, "Auto",
    // Common Node and group bindings to properties
    new go.Binding("isSubGraphExpanded").makeTwoWay(),
    new go.Binding("location", "loc", go.Point.parse).makeTwoWay(go.Point.stringify),
    new go.Binding("visible", "visible"),
    // {
    //   dragComputation: avoidNodeOverlap,
    // },
    {
      /**
       * Is triggered when parts are added as children to a group. This function
       * updates the node and group panels within this template to show or hide if there are children in the group.
       */
      memberAdded: updateGroupMembers,
      /**
       * Is triggered when parts are removed from a group. This function
       * updates the node and group panels within this template to show or hide if there are children in the group.
       */
      memberRemoved: updateGroupMembers,
    },
    // Group Panel
    $$(go.Panel, { name: "GroupPanel", visible: false }, groupPanel()),
    containmentSelection(),

    // Node Panel. Displays the Group to look like a node as default
    $$(go.Panel, { name: "NodePanel", visible: true }, nodePanel()),
  );
  template.layout = $$(TestLayout,
    { // add gridlayout to diagram
      wrappingColumn: (3),
      wrappingWidth: (diagram.model.nodeDataArray.length),
      spacing: new go.Size(2, 2),
      isInitial: false,
      isOngoing: true // set to true so group layout applies when nodes are added
    });
  return template;
}

