function containmentSelection() {
  return {
    selectionAdornmentTemplate: // adornment when a group is selected
      $$(go.Adornment, "Auto",
        $$(go.Shape, "RoundedRectangle",
          { fill: "rgba(59,83,107,0.25)", stroke: "rgba(0,0,0,0)", strokeWidth: 3, strokeDashArray: [3] }),
        $$(go.Placeholder)
      ),
    toSpot: go.Spot.AllSides, // links coming into groups at any side
    toEndSegmentLength: 30, fromEndSegmentLength: 30,
    alignment: go.Spot.Left,
  };
}

function updateGroupMembers(group: go.Group, part: go.Part) {
	const nodePanelPart = group.findObject("NodePanel") as unknown as Node;
	const groupPanelPart = group.findObject("GroupPanel") as go.Panel;
	const hasChildren = (group.memberParts.count > 0);
	group.data.groupHasChildren = hasChildren;

	if (nodePanelPart !== null) {
		(nodePanelPart as any).visible = !hasChildren;
	}
	if (groupPanelPart !== null) {
		groupPanelPart.visible = !!hasChildren;
		const groupHeader = groupPanelPart.findObject("group-header");
		groupHeader.visible = groupPanelPart.visible;
	}
}

function getLinkTemplate() {
	// return $$(go.Link,
	//     { curve: go.Link.Bezier },
	//     $$(go.Shape,
	//     { strokeWidth: 1, stroke: "#44CCFF" })
	// );
	return $$(
		go.Link,
		{
			routing: go.Link.Normal,
			curve: go.Link.None,
			selectable: false,
		},
		$$(
			go.Shape, // the highlight shape, normally transparent
			{ isPanelMain: true, strokeWidth: 8, stroke: "transparent", name: "HIGHLIGHT" },
			new go.Binding("stroke", "temporaryMode", function () {
				return "#f46c6c";
			})
		),
		$$(
			go.Shape, //  the link shape
			{ isPanelMain: true, name: "OBJSHAPE", strokeWidth: 3.5 },
			new go.Binding("stroke", "color")
		)
	);
}

