myDiagram.model = go.Model.fromJson(SampleModelJSON);
myDiagram.model.nodeKeyProperty = "id";
(myDiagram.model as any).linkKeyProperty = "id";

const containmentExamples = [
      { relationship: "contains" },
			{ relationship: "B" },
			{ relationship: "C" },
			{ relationship: "CP" },
			{ relationship: "G" },
			{ relationship: "I" },
			{ relationship: "L" },
			{ relationship: "U" },
			{ relationship: "V" },
			{ relationship: "W" },
			{ relationship: "B  B" },
			{ relationship: "C  B" },
			{ relationship: "CP B" },
			{ relationship: "G  B" },
			{ relationship: "I  B" },
			{ relationship: "L  B" },
			{ relationship: "U  B" },
			{ relationship: "V  B" },
			{ relationship: "W  B" }
]

function removeContainmentGroups(diagram: go.Diagram) {
	const links = diagram.findLinksByExample(...containmentExamples);
	diagram.commit(_diagram => {
		const model = _diagram.model as go.GraphLinksModel;
		_diagram.nodeTemplate = _diagram.nodeTemplateMap.get("OFF");
		_diagram.groupTemplate = _diagram.groupTemplateMap.get("OFF");
		removeGroups(model);
		// Showing the containment edges since we are showing groups.
		links.each(link => {
			model.setDataProperty(link.data, "visible", true);
		});
	}, "Containment Switch");
}

function removeGroups(model: go.GraphLinksModel) {
	model.commit((_model: go.GraphLinksModel) => {
		_model.nodeDataArray.forEach(node => {
			if (node["group"] != null) {
				_model.setDataProperty(node, "group", null);
			}
		});
	}, "GROUP_REMOVED");
}

export interface WhiteboardNode {
	readonly id: string;
	readonly nodeTypes: string[];
	readonly geo: string;
	readonly beNum: string;
	readonly oSuffix: string;
	readonly isGroup?: boolean;
	readonly classification: string;
	readonly label: string;
	// note on "loc": The diagram layout is not auto-updating, which is what normally gives the node its initial point.
	// Without a location, it won't be displayed.
     loc?: string;
     /**
      * Marks a node that is temporarily on the diagram as an Add Neighbor mode which
      * hasn't been confirmed yet.
      */
	tmp_node?: boolean;
     style?: any;
     not_a_dup?: boolean;
     /**
      * If this node is part of a group, this property will
      * hold the id of the node's parent
      */
     group?: string;
}

export interface WhiteboardEdge {
	readonly id: string;
	readonly from: string;
	readonly to: string;
  readonly relationship: string;
  readonly containment: "forward" | "reverse";
  color?: string;
  label?: string;
  directionality?: any;
  confidenceLevel?: any;
  visible?: boolean;
}

function generateContainmentGroups(diagram: go.Diagram, model: go.GraphLinksModel) {
	// Getting all of the edges that deem a parent/child relationship.

	// Identify containment links
	const linkParents = diagram.findLinksByExample(...containmentExamples);
	// Starting a transaction so we can identify it in save.

	/*
	Storing the links before we do the transaction because in the case of a failure when setting the nodeDataArray
	because of the following:
		1. GoJS doesn't track nor create changeEvents done to the nodeDataArray and linkDataArray
		2. if the nodeDataArray fails when setting it, the links in the linkDataArray gets their to and from set to undefinded.
	I'm using JSON stringify and parse to clone the POJO (plain old javascript objects) from the OG array,
	so that in case of a faulure, we can recover the original links.
	*/
	const originalLinks = (JSON.parse(JSON.stringify((diagram.model as go.GraphLinksModel).linkDataArray)) as WhiteboardEdge[]);
	try {
		diagram.commit(d => {
			try {
				d.groupTemplate = d.groupTemplateMap.get("ON");

				linkParents.each(link => {
					let parentNodeKey = "";
					let childNodeKey = "";
					let parentNode: go.GraphObject & WhiteboardNode = null;
					let childNode: WhiteboardNode = null;
					// If there's data associated with the link/edge, we'll grab the parent and child nodes.
					const edge = link.data as WhiteboardEdge;
					if (edge?.relationship) {
						if (edge.relationship.includes("B")) {
							parentNodeKey = edge.to;
							childNodeKey = edge.from;
							parentNode = d.model.findNodeDataForKey(parentNodeKey) as go.GraphObject & WhiteboardNode;
							childNode = d.model.findNodeDataForKey(edge.from) as WhiteboardNode;
						} else {
							parentNodeKey = edge.from;
							childNodeKey = edge.to;
							parentNode = d.model.findNodeDataForKey(parentNodeKey) as go.GraphObject & WhiteboardNode;
							childNode = d.model.findNodeDataForKey(edge.to) as WhiteboardNode;
						}
					}

					// Only do the containment stuff if both the parent AND the child are in the diagram
					if (parentNode && childNode) {
						// set child to be placed inside of parent group
						if (parentNodeKey === childNodeKey) {
							// don't allow a node to be its own parent
							console.debug("Can't group a node within itself:", childNodeKey);
						} else if (hasParent(parentNode, childNodeKey, model)) {
							// don't allow a child to become it's own grandparent, great-grandparent, etc
							console.debug(`Can't group ${childNodeKey} within ${parentNodeKey} because the former is already a parent of the latter.`);
						} else if (!childNode.group) {
							d.model.setDataProperty(childNode, "group", parentNodeKey);
							d.model.setDataProperty(edge, "visible", false);
						} else if (childNode.group === parentNodeKey) {
							if (!parentNode.isGroup) {
								d.model.setDataProperty(parentNode, "isGroup", true);
							}
							// there are scenarios (like merged nodes from file import) where we could have nearly duplicate edges
							// If the edge is a containment edge and the two nodes are already grouped, just make the near-dupe edge invisible
							d.model.setDataProperty(edge, "visible", false);
							console.log("duplicate Edge");	// ER_NOTE
						} else {
							console.debug(`Child node ${childNode.id} was already attached to parent ${childNode.group} and couldn't be attached to ${parentNodeKey}. EdgeID: ${edge.id}`);
						}
					}
				});
			} catch (err) {
				console.log(err);	// ER_NOTE
			}
			// Finalizing the transaction
		}, "GROUP_MADE");
	} catch (exception) {
		console.warn("Issue with generating groups. Restoring previous links...");
		model.linkDataArray = originalLinks;
		throw exception;
	}
}
function hasParent(node: WhiteboardNode, searchNodeKey: string, model: go.GraphLinksModel): boolean {
	if (node.group) {
		if (node.group === searchNodeKey) {
			return true;
		} else {
			const parentNode = model.findNodeDataForKey(node.group) as WhiteboardNode;
			return hasParent(parentNode, searchNodeKey, model);
		}
	} else {
		return false;
	}
}

function runLayout(diagram: go.Diagram) {
  diagram.layout = new go.TreeLayout();
}

const groupBtn = document.querySelector("#groupBtn");
const ungroupBtn = document.querySelector("#ungroupBtn")

function group() {
  const serializedDiagram = myDiagram.model.toJson();
  const newDiagram = getDiagram();
  
  newDiagram.model = go.GraphLinksModel.fromJson(serializedDiagram);

  console.log("before containment")	// ER_NOTE
  newDiagram.startTransaction("TEST");
  generateContainmentGroups(newDiagram, newDiagram.model as go.GraphLinksModel);
  console.log("after Containment")	// ER_NOTE

  runLayout(newDiagram);
  newDiagram.commitTransaction("TEST")
  console.log("after layout");

  myDiagram.commit(() => {
    console.log("apply to main diagram")	// ER_NOTE
    myDiagram.model.mergeNodeDataArray(newDiagram.model.nodeDataArray);
    (myDiagram.model as go.GraphLinksModel).mergeLinkDataArray((newDiagram.model as go.GraphLinksModel).linkDataArray);
    myDiagram.groupTemplate = myDiagram.groupTemplateMap.get("ON");
  })

  console.log("done")	// ER_NOTE
}

groupBtn.addEventListener("click", group);

function ungroup() {
  removeContainmentGroups(myDiagram);
}

ungroupBtn.addEventListener("click", ungroup);